// Basic Content component that will be rendered when the user navigates to the root URL. This component will display a simple message to the user.
import React from 'react';

// TODO: Place the logo for the websitec(ValorantAnalyzerLogo2.png in the public folder) here and style it to be centered on the page.
const Content = () => {
  return (
    <div>
      <img src="/ValorantAnalyzerLogo2.png" alt="Valorant Analyzer Logo" style={{display: 'block', marginLeft: 'auto', marginRight: 'auto', width: '50%'}}/>
      <h2>Welcome to Valorant Analyzer</h2>
      <p>Use this website to analyze your Valorant stats and improve your gameplay.</p>
      <p>Sign in with Riot in the top right corner to get started!</p>
    </div>
  );
};

export default Content;
